import React from 'react';

const CardIcons = () => {
    <CardActions disableSpacing>
        <IconButton aria-label="add to favorites">
            <FavoriteIcon />
        </IconButton>
        <IconButton aria-label="share">
            <ShareIcon  />
        </IconButton>
    </CardActions>
}

export default CardIcons;
